function largest(arr, n) {
  let max = arr[0];

  for (let i = 1; i < n; i++) {
    if (arr[i] > max) {
      max = arr[i];
    }
  }

  return max;
}

function checkInArray(array, number) {
  const hashTable = {};

  for (const item of array) {
    hashTable[item] = true;
  }

  return number in hashTable;
}

